exports=async function(bid,options){const{parseCatalog}=await require("transcode/parse_catalog"),url=`https://www.biqudu.net/${bid.idPrefix()}_${bid}/`;return parseCatalog(url,"div#list>dl>dd",{clientOptions:{...(options&&options.clientOptions)}}).then(_=>{for(let c of _)c.name=c.name.replace(/^【/,"").replace(/】$/,"").trim();return _})};